@77x5ghost That seems to be an issue with the new nightly versions of PCSX2. I did this ripping process with PCSX2 1.6.0, which is an older version that still allows you to see in-game memory.
Edit: it is still possible with new builds, you just need to do a full search instead of a normal search (PCSX2 Wiki page for this needs to be updated)
Edit 2: the even newer nightly releases of PCSX2 have a better debugger, that can search for memory contents and do filter searches kind of like cheat engine, but within the PS2 memory itself (the old one didn't really allow you to do that which is why you needed Cheat Engine)
